import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div>
        <Router>
    <Switch>
      <Route exact path="/" component={Home}/> 
      <div>



      <Footer />
      </div>  
    </Switch>
    </Router>

    </div>

  );
}

export default App;
